@Close2theFir3 The psychological effect tbh.
Roid rage is real and so is massive depression.
Nothing like wanting to beat the shit out someone and thinking you’re the best meanwhile being depressed. 😅

Comprendre ensuite la logique;
Se donne les moyens,
Le message crache boulons,
Le gobelet par perception;
S'illumine anatomiquement,
Tout à coup la vision;
Convulse interloquée,
Calfeutrer la divinité;
Si tu pouvais être la vision,
Le crâne trouve rage et désarroi.
